import React from "react";

function Header() {
  return (
    <header>
     <div className="container myheader">
     <div class="container">
     <div class="row">

    <strong><i className="fa fa-heart fa-4x style"><h1>GOOGLE BOOKS</h1></i></strong> 



    <div class="col-6 col-sm-3"><h4>Saved</h4></div>

    </div>
    </div>
  </div>
   </header>

  );
}

export default Header;
